import React from 'react'
import { BrowserRouter,Switch,Route,Redirect } from 'react-router-dom'


import Header from './Header.js'
import Footer from  './Footer.js'
import Home from './Home.js'
import Registration from './Registration.js'
import RestapiData from './Restapi_data.js'
import Restapi_data_view from './Restapi_data_view'

import Pagenotfound from './Pagenotfound.js'



const Routing=()=>
{
    return(
        <>
            <BrowserRouter>


                {/* Header */}
                    <Header /> 
                {/* Header */} 


                <Switch>

                    <Route exact path="/" component={Home} />
                    <Route path="/home" component={Home} />
                    <Route exact path="/registration" component={Registration} />
                    <Route path="/user/" component={RestapiData} />
                    <Route path="/user/view/:idno" component={Restapi_data_view} />

                    {/* redirect to default component */}
                    <Redirect to={`/home`} />

                    {/* default pagenotfound component */}
                    <Route component={Pagenotfound} />

                </Switch>


                {/* Footer */}
                    <Footer /> 
                {/* Footer */} 


            </BrowserRouter>

        </>
    )

}

export default Routing;
